import React from "react";
import "./Navbar.css";
import { useTranslation } from "react-i18next";

function Navbar() {
  const { t, i18n } = useTranslation();
  return (
    <div>
      <header className="header">
        <h1>{t("Layout & Style")}</h1>
      </header>
    </div>
  );
}

export default Navbar;
